import React, { useState } from 'react';

const Dashboard = () => {
  const totalCustomers = 1;
  const totalBookings = 0;
  const totalProducts = 13;

  const [showProductDropdown, setShowProductDropdown] = useState(false);

  const toggleDropdown = () => {
    setShowProductDropdown(!showProductDropdown);
  };

  const styles = {
    dashboard: {
      fontFamily: "'Arial', sans-serif",
      textAlign: 'center',
      padding: '20px',
      backgroundColor: '#f8f9fa',
      height: '100vh'
    },
    header: {
      backgroundColor: '#000',
      padding: '15px',
      color: 'white',
      textAlign: 'left',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    },
    nav: {
      display: 'flex',
      justifyContent: 'flex-end',
      marginRight: '20px',
      position: 'relative',
      alignItems: 'center'
    },
    navLink: {
      color: 'white',
      margin: '0 15px',
      textDecoration: 'none',
      position: 'relative',
      cursor: 'pointer'
    },
    dropdownMenu: {
      position: 'absolute',
      top: '100%',
      backgroundColor: '#333',
      borderRadius: '4px',
      display: showProductDropdown ? 'block' : 'none',
      padding: '10px',
      zIndex: 1
    },
    dropdownItem: {
      color: 'white',
      padding: '10px 15px',
      textDecoration: 'none',
      display: 'block',
      backgroundColor: '#444',
      margin: '5px 0',
      borderRadius: '4px'
    },
    dropdownItemHover: {
      backgroundColor: '#555'
    },
    metrics: {
      display: 'flex',
      justifyContent: 'space-around',
      margin: '40px 0',
      padding: '0 20px'
    },
    metric: {
      backgroundColor: '#e9ecef',
      padding: '20px',
      borderRadius: '8px',
      width: '200px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
      textAlign: 'center'
    },
    metricHeader: {
      fontSize: '24px',
      marginBottom: '10px',
      color: '#007bff',
      textDecoration: 'underline'
    },
    metricValue: {
      fontSize: '36px',
      fontWeight: 'bold'
    },
    welcome: {
      color: 'red',
      marginLeft: 'auto',
      marginRight: '10px',
      fontWeight: 'bold'
    }
  };

  return (
    <div style={styles.dashboard}>
      <header style={styles.header}>
        <h1>Online Medical Shop</h1>
        <nav style={styles.nav}>
          <a href="Home" style={styles.navLink}>Home</a>
          <a href="#" style={styles.navLink}>View User</a>
          <a href="#" style={styles.navLink}>View Booking</a>
          <a href="#" style={styles.navLink}>View Feedback</a>

          <div style={styles.navLink} onClick={toggleDropdown}>
            Products ▼
            <div style={styles.dropdownMenu}>
              <a href="#" style={styles.dropdownItem}>Add Product</a>
              <a href="#" style={styles.dropdownItem}>View Product</a>
            </div>
          </div>
          
          <div style={styles.navLink} onClick={toggleDropdown}>
            Products ▼
            <div style={styles.dropdownMenu}>
              <a href="#" style={styles.dropdownItem}>Add Product</a>
              <a href="#" style={styles.dropdownItem}>View Product</a>
            </div>
          </div>
          <a href="#" style={styles.navLink}>Category</a>
          <a href="#" style={styles.navLink}>Logout</a>
        </nav>
      </header>

      <div style={styles.metrics}>
        <div style={styles.metric}>
          <h2 style={styles.metricHeader}>Total Customer</h2>
          <p style={styles.metricValue}>{totalCustomers}</p>
        </div>
        <div style={styles.metric}>
          <h2 style={styles.metricHeader}>Total Booking</h2>
          <p style={styles.metricValue}>{totalBookings}</p>
        </div>
        <div style={styles.metric}>
          <h2 style={styles.metricHeader}>Total Product</h2>
          <p style={styles.metricValue}>{totalProducts}</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
